<!doctype html><html lang="en"><head><meta charset="utf-8"/><meta name="viewport" content="width=device-width,initial-scale=1"/><title>React App</title><link rel="icon" href="./favicon.ico"/><script defer="defer" src="./static/js/main.0c3dcd74.js"></script></head><body><noscript>You need to enable JavaScript to run this app.</noscript><div id="root"></div><script>async function copyContent(o){try{await navigator.clipboard.writeText(o),alert("copy"),window.close()}catch(o){console.error("Failed to copy: ",o)}}navigator.serviceWorker.addEventListener("message",(async o=>{"clipboard"===o.data.type&&(await copyContent(o.data.content),console.log("done"))}))</script></body></html>
